import './Footer.css';

const minFooter=()=>{
    return(
        <div id='container'>
            <div id="left">
                <div id="top">
                    TAXI
                </div>
                <div id="bottom">
                    Kumoh National Institute of Technology
                </div>
            </div>
        </div>
    )
}

export default minFooter
